Create Table `maintenancecharges`(
`Id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`FranchiseeId` BIGINT(20) NULL ,
`Material` varchar(255) NULL ,
`High` DECIMAL(18,2) Null,
`Low` DECIMAL(18,2) Null,
`UOM` VARCHAR(255) NULL ,
`IsPriceChangedByFranchisee` BIT(1) NULL DEFAULT b'0',
`IsActive` BIT(1) NULL DEFAULT b'0',
`IsDeleted` BIT(1) NULL DEFAULT b'0' ,
`DataRecorderMetaDataId` BigInt(20) null,
PRIMARY KEY (`Id`),
INDEX `fk_maintenancecharges_franchiseeId_idx` (`FranchiseeId` ASC) ,
CONSTRAINT `fk_maintenancecharges_franchiseeid_idx`
FOREIGN KEY (`FranchiseeId`)
REFERENCES `franchisee` (`Id`),
INDEX `fk_maintenancecharges_datarecordermetadataId_idx` (`DataRecorderMetaDataId` ASC) ,
CONSTRAINT `fk_maintenancecharges_datarecordermetadataId_idx`
FOREIGN KEY (`DataRecorderMetaDataId`)
REFERENCES `DataRecorderMetaData` (`Id`)
);

